import React from "react";

const HomeAssignment = () => {
  return (
    <div className="assingment-types">
      <div className="card">
        <div className="img-wrapper">
          <img
            src="https://images.unsplash.com/photo-1531988042231-d39a9cc12a9a?q=80&w=1470&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D"
            alt=""
          />
        </div>
        <div className="card-body">
          <p>
            We offer help in custom essay writing services. We deliver top-notch
            quality in argumentative essays, expository essays, narrative essays
            and descriptive essays. Our papers are free from grammatical errors
            and 100% Original.
          </p>
        </div>
      </div>
    </div>
  );
};

export default HomeAssignment;
